import styled from 'styled-components';


export const MainContainer = styled.div`
display: flex;
flex-direction: row;
flex-wrap: wrap;
`;


export const StyledDiv = styled.div`
  background-color: gray;
  border: 12px solid black;
  padding: 4px 10px;
  color: white;
  height:300px;
  width:200px
`

export const Image = styled.img`
height:150px;
width:150px;
`
